/**
 * Insights Engine
 *
 * Processes insight definitions from insights.json and classifies them
 * as strengths or areas of improvement based on user's metric scores.
 *
 * Logic:
 * - For each insight definition, calculate average score of affected metrics
 * - Weakness: if avg score < threshold â†’ classify with severity label
 * - Strength: if avg score > threshold â†’ classify with grade label
 *
 * Z-Score Based 5-Tier Severity Logic:
 * - Ideal (Green): User is inside the ideal range
 * - Good (Blue): Within 0.5 Standard Deviation of the mean (|z| < 0.5)
 * - Fair (Cyan): Between 0.5 and 1 Standard Deviation (0.5 â‰¤ |z| < 1)
 * - Moderate (Yellow): Between 1 and 2 Standard Deviations (1 â‰¤ |z| < 2)
 * - Severe (Red): More than 2 Standard Deviations away (|z| â‰¥ 2)
 *
 * Severity Labels (Weaknesses):
 *   0-3 = "Severe"
 *   3-5 = "Moderate"
 *   5-7 = "Minor"
 *
 * Grade Labels (Strengths):
 *   8-9   = "Good"
 *   9-9.5 = "Excellent"
 *   9.5-10 = "Ideal"
 */

